"""## Segmention of rectangles"""

#crop out of the image 3 rectangles, first one - the leaf, second - the yellow reference , third - the green reference
def crop_leaf(image):
  original_image= image.copy()

  blur = cv2.pyrMeanShiftFiltering(original_image, 11, 21) #reduce noise for Canny
  gray = cv2.cvtColor(blur, cv2.COLOR_BGR2GRAY) #Canny requires grayscale
  thresh = cv2.threshold(gray, 0, 255, cv2.THRESH_BINARY_INV + cv2.THRESH_OTSU)[1]#create binary image

  edges= cv2.Canny(gray, 50, 200)#detect edges

  #join continuous points along the boundary of the binary image
  contours, hierarchy= cv2.findContours(thresh, cv2.RETR_EXTERNAL, cv2.CHAIN_APPROX_SIMPLE)

  #sort according to contour areas in descending order
  sorted_contours= sorted(contours, key=cv2.contourArea, reverse= True)

  for (i,c) in enumerate(sorted_contours):
    if i == 3: #we only need 3 rectangles, so we take the 3 largest
        break
    x,y,w,h= cv2.boundingRect(c) #create bounding rectangle around object
      
    cropped_contour= original_image[y:y+h, x:x+w] #crop image
    image_name= "output_shape_number_" + str(i+1) + ".jpg" #name image
    cv2.imwrite(f'/content/drive/MyDrive/N_plant_images_cropped/{image_number}/{image_name}', cropped_contour) #save image